import React from 'react';
import classes from './Order.css'

const order = props => (
    <div className={classes.Order}>
        <p>Ingredients: Salad</p>
        <p>{props.price}</p>
        <p>Price: <strong>{Number.parseFloat(props.price).toFixed(2)}</strong></p>
    </div>
);

export default order;
